pc.script.createLoadingScreen(function (app) {
  app.firstLoad = true;

  const bg64 =
    "url(data:image/png;base64,)";

  app.logo =
    "data:image/png;base64,";

  var showSplash = function () {
    // splash wrapper
    var wrapper = document.createElement("div");
    wrapper.id = "application-splash-wrapper";
    document.body.appendChild(wrapper);

    // splash
    var splash = document.createElement("div");
    splash.id = "application-splash";
    wrapper.appendChild(splash);
    splash.style.display = "none";

    // spinner
    var spinner = document.createElement("div");
    spinner.id = "spinner";
    splash.appendChild(spinner);

    // logo
    var logo = document.createElement("img");
    logo.src = app.logo;
    splash.appendChild(logo);
    logo.onload = function () {
      splash.style.display = "block";
    };

    var container = document.createElement("div");
    container.id = "progress-bar-container";
    splash.appendChild(container);

    var bar = document.createElement("div");
    bar.id = "progress-bar";
    container.appendChild(bar);
    bar.appendChild(spinner);

    var status = document.createElement("div");
    status.id = "progress-status";
    status.textContent = "Loading";
    status.style.textAlign = "center";
    status.style.fontFamily = "Impact,sans-serif";
    status.style.color = "white";
    status.style.position = "relative";
    status.style.bottom = "95%";
    container.appendChild(status);
  };

  var hideSplash = function () {
    var splash = document.getElementById("application-splash-wrapper");
    if (splash.parentElement) {
      splash.parentElement.removeChild(splash);
    }
  };

  var setProgress = function (value) {
    var bar = document.getElementById("progress-bar");
    if (bar) {
      value = Math.min(1, Math.max(0, value));
      bar.style.width = value * 100 + "%";
    }
  };

  var createCss = function () {
    var css = [
      "body {",
      "    background-image:" + bg64 + ";",
      "background-size: 100% 100%;",
      "}",
      "",
      "#application-splash-wrapper {",
      "    position: absolute;",
      "    top: 0;",
      "    left: 0;",
      "    height: 100%;",
      "    width: 100%;",
      "    background-size: cover;",
      "    background-image:" + bg64 + ";",
      "object-fit: cover;",
      "}",
      "",
      "#application-splash {",
      "    position: fixed;",
      "    width: 35%;",
      "    top: 50%;",
      "    left: 50%;",
      "    transform: translate(-50%, -50%);",
      "}",
      "",
      "#application-splash img {",
      "object-fit: cover;",
      "    width: 100%;",
      "}",
      "",
      "#progress-bar-container {",
      "    border-radius: 15px;",
      "    margin: 20px auto 0 auto;", // Add a 100px top margin
      "    height: 25px;",
      "    width: 100%;",
      "    background-color: #171717;",
      "    border: 4px solid #171717;",
      "}",
      "",
      "#progress-bar {",
      "    border-radius: 15px;",
      "    width: 0%;",
      "    height: 100%;",
      "    background-color: #ff8a1c;",
      "    box-shadow: inset 0 2px 5px #e8ff1c;",
      "}",
      "@keyframes spinner {",
      "    0% {",
      "        transform: translate3d(-50%, -50%, 0) rotate(0deg);",
      "    }",
      "    100% {",
      "        transform: translate3d(-50%, -50%, 0) rotate(360deg);",
      "    }",
      "}",
      "#spinner::before {",
      "    animation: 0.6s linear infinite spinner;",
      "    animation-play-state: inherit;",
      "    border: solid 10px #171717;",
      "    border-bottom-color: #ff8a1c;",
      "    border-radius: 50%;",
      '    content: "";',
      "    height: 20px;",
      "    width: 20px;",
      "    position: absolute;",
      "    top: calc(100% + 40px);",
      "    left: 50%;",
      "    transform: translate3d(-50%, 0, 0);",
      "    will-change: transform;",
      "}",
      "@font-face {",
      '    font-family: "kenvector_future";',
      '    src: url({asset[font-thin]}) format("woff");',
      "    font-weight: normal;",
      "    font-style: normal;",
      "}",
    ].join("\n");

    var fontThin = app.assets.get(121143033);
    if (fontThin)
      css = css.replace("{asset[font-thin]}", fontThin.getFileUrl());
    var fontLight = app.assets.get(121143033);
    if (fontLight)
      css = css.replace("{asset[font-light]}", fontLight.getFileUrl());

    var style = document.createElement("style");
    style.type = "text/css";
    if (style.styleSheet) {
      style.styleSheet.cssText = css;
    } else {
      style.appendChild(document.createTextNode(css));
    }

    document.head.appendChild(style);
  };

  createCss();
  showSplash();
  app.startOld = app.start;
  app.start = function () {
    return app.startOld();

    var shaderCacheAsset = app.assets.findByTag("shader-cache")[0];
    if (!shaderCacheAsset) return app.startOld();

    var device = app.graphicsDevice;
    var cache = device.programLib._cache;

    var shaders = shaderCacheAsset.resource.split("^SH^");
    var shadersTotal = shaders.length;
    var shadersCompiled = 0;

    var compileBudget = 50;
    var compileStart = Date.now();

    var compileQueue = function () {
      compileStart = Date.now();
      compileNext();
    };

    var compileNext = function () {
      if (shaders.length === 0) {
        var status = document.getElementById("progress-status");
        if (status) status.textContent = "initializing";

        return requestAnimationFrame(function () {
          app.startOld();
        });
      }

      var str = shaders.shift();

      if (!str) return compileNext();

      var vsStart = str.indexOf("^VS^");
      var psStart = str.indexOf("^PS^");
      var atStart = str.indexOf("^AT^");

      var entry = str.substring(0, vsStart);
      if (cache[entry]) return compileNext();

      var vsCode = str.substring(vsStart + 4, psStart);
      var psCode = str.substring(psStart + 4, atStart);
      var attribsString = str.substring(atStart + 4, str.length);

      var a1 = attribsString.split(",");
      var attribs = {};
      for (var j = 0; j < a1.length - 1; j += 2) attribs[a1[j]] = a1[j + 1];

      var def = {
        vshader: vsCode,
        fshader: psCode,
        attributes: attribs,
      };

      cache[entry] = new pc.Shader(device, def);
      device.setShader(cache[entry]);
      shadersCompiled++;

      if (Date.now() - compileStart < compileBudget) {
        compileNext();
      } else {
        var status = document.getElementById("progress-status");
        if (status)
          status.textContent =
            shadersCompiled + " / " + shadersTotal + " shaders compiled";

        setProgress(shadersCompiled / shadersTotal + 1.0);
        requestAnimationFrame(compileQueue);
      }
    };

    var status = document.getElementById("progress-status");
    if (status)
      status.textContent =
        shadersCompiled + " / " + shadersTotal + " shaders compiled";
    requestAnimationFrame(compileQueue);
  };

  app.on("preload:start", function () {
    const assetsArray = Array.from(app.assets._assets);

    var loaded = 0;
    var total = 0;

    /*  app.assets.on('load', function () {
              loaded++;
              var status = document.getElementById('progress-status');
  
              if (!status)
                  return;
  
              // status.textContent = loaded + ' / ' + total + ' seeds planted';
              status.style.textAlign = 'center';
              status.textContent = loaded + ' / ' + total;
  
              if ((loaded / total) > 0.95)
                  status.textContent = 'Fertilizing soil';
          }) */

    var onLoad = function () {
      loaded++;
      var status = document.getElementById("progress-status");

      if (!status) return;

      // status.textContent = loaded + ' / ' + total + ' seeds planted';
      status.style.textAlign = "center";
      status.textContent = loaded + " / " + total;

      if (loaded / total > 0.95) status.textContent = "Loading";
    };

    for (let i = 0; i < assetsArray.length; i++) {
      var asset = assetsArray[i];

      if (!asset || !asset._preload) continue;

      total++;

      if (asset.resource) {
        onLoad();
      } else {
        asset.once("load", onLoad);
      }
    }
  });

  app.on("preload:end", function () {
    app.firstStart = true;

    window.addEventListener("keydown", (ev) => {
      if (["ArrowDown", "ArrowUp", " "].includes(ev.key)) {
        ev.preventDefault();
      }
    });
    window.addEventListener("wheel", (ev) => ev.preventDefault(), {
      passive: false,
    });
    app.off("preload:progress");
  });
  app.on("preload:progress", setProgress);
  app.on("start", hideSplash);
});
